import { Link } from "react-router-dom";
import React, { useContext } from "react";
import { useNavigate } from "react-router-dom";
import { AuthContext } from "../contex/Authenticate";
import axios from "axios";
import { Routes, Route } from "react-router-dom";
import Perfiluser from "./Perfiluser";

const Navbar = () => {
  const navegate = useNavigate();
  const { toggleAuth, isAuthenticated, name } = useContext(AuthContext);

  const logOut = () => {
    toggleAuth();
    axios
      .post("http://localhost:1337/api/users/logout")
      .then((res) => {
        localStorage.removeItem("name", JSON.stringify(res.data));
      })
      .then(() => navegate("/login"));
  };

  return (
    <nav>
      <ul>
        <li>
          {" "}
          <Link to={"/perfiluser"}>{name}</Link>
        </li>
        <li>
          <a href="/" class="activo" className="moviesmaxs">
            MoviesMaxs
          </a>{" "}
        </li>
        <li>
          <Link to="/search">
            <button className="search">Search</button>
          </Link>
        </li>
        <li>
          <Link to="/register">
            <button className="register">Register</button>
          </Link>
        </li>
        <li>
          {" "}
          {!isAuthenticated ? (
            <Link to="/login">
              <button className="login">Login</button>
            </Link>
          ) : (
            <Link to="/">
              <button className="login" onClick={logOut}>Logout</button>
            </Link>
          )}
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
